        self.lblAbout.setText(_translate("formConfig", "<html><head/><body><p align=\"center\"><span style=\" font-size:12pt; text-decoration: underline;\">What is Scurry?</span></p><p align=\"justify\"><span style=\" font-size:10pt;\">The primary idea behind Scurry is that I wanted to make a fun, engaging, and customizeable mouse overlay for streamers. Keyboard overlays are dynamic and fairly easy to customize, but it\'s been my experience that mouse overlays are more static and boring than their keyboard counterparts. The two most popular mouse overlays I am aware of (the Input Overlay plugin for OBS, and the Nohboard standalone app) both capture the mouse button presses, but they don\'t capture the movement of the mouse in quite the way I wished they would. And so, after about a week of searching, another week of conversations with chatGPT, a week or so of figuring out how VSCode works, and 3 months worth of learning python, Scurry is now a thing that exists! And it exists for you to use and make your own.</span></p><p align=\"center\"><span style=\" font-size:10pt;\">Scurry was built from the ground up with 4 things in mind: </span></p><p><span style=\" font-size:10pt;\">1) The app should be as easy to use as possible. This meant that I started the project with the ultimate goal of being able to compile the entire program into a single binary that could run on any platform (I KNOW PYTHON ISN\'T SUPPOSED TO BE COMPILED...C++ WAS SCARY FOR A NOOB LIKE ME). Click. Launch. Done. I really tried my hardest to make the GUI easy to navigate and understand, but am fully aware that I tend to be a bit overly verbose. I hope that my verbose attempts to over-inform the user are better than the alternative.</span></p><p><span style=\" font-size:10pt;\">2) The app needs to be STABLE. I mean REALLY stable. I really, really, really, really, really don\'t want this app to crash for people, or to have random annoying bugs that just make it a drudge to use. I really put a lot of my time and energy into error handling and generally just trying to make this app difficult to break without actually going in and messing with the source code. I\'m sure there will inevitably be bugs and crashes after release, but just know that I care a lot about creating a stable, seamless experience, and that I take crashes and bug reports seriously. </span></p><p><span style=\" font-size:10pt;\">3) The app should be as customizeable as possible. If I have to make a decision as a programmer, I should be able to pass the freedom to make that decision to the end user. As such, there are 38 customizeable parameters that you can change to your heart\'s intent. Go nuts :)</span></p><p><span style=\" font-size:10pt;\">4) The app should be free and open source. I planned from the very beginning to dive head first into the world open source software when making this app. I am so thankful for all of the wonderful tools that the passionate members of the FOSS community have made and shared--I use plenty of open source tools, and I feel obliged to give back in my own way. I believe in the collective good of the community and that the collective wisdom of the community will exceed anything I could ever be capable of on my own. I tried really hard to make it easy to learn and understand the source code for my app, with the full expectation that others may very well end up reading it and modifying it. Please forgive my inexperience, though, as I really don\'t know any of the common open-source conventions people use when building software.</span></p><p align=\"center\"><span style=\" font-size:12pt; text-decoration: underline;\">About The Author</span></p><p align=\"justify\"><span style=\" font-size:10pt;\">Uhhh I\'m not really sure what to put here. I\'m Contemplaytion. My friends call me &quot;Ctemp.&quot; I play games sometimes, and stream for fun every now and then. I will say that even though I technically developed this app, I wouldn\'t really call myself a developer. I have no ambitions to become a developer, either--but learning python was a lot of fun and I definitely recommend it as a language for beginners who want to give programming a try. Just...don\'t use python to develop an app like I did...Python really isn\'t great for that :/ Anyways, while I\'m not very experienced in coding or working with python, I am very open to ideas and feedback!</span></p><p align=\"center\"><span style=\" font-size:12pt; text-decoration: underline;\">Inspiration and Thank Yous</span></p><p align=\"justify\"><span style=\" font-size:10pt;\">Scurry was inspired in part by Nohboard, as it is a standalone app intended to be used via window capture in OBS with a chroma key applied. The colored trail effect was inspired by AimLabs, where a very similar technique is used to analyze mouse movements for aim training. Finally, I want to give credit where it is due: the overall visual design of scurry was inspired by a few speedruns of &quot;A Difficult Game About Climbing,&quot; by Clark, who used what appeared to be a mouse overlay custom-built specifically for the game. I knew the moment I saw the thumbnail that the concept was exactly what I always wanted to see in a mouse overlay, and I was determined to turn the idea into something more generalized and customizeable.</span></p><p align=\"justify\"><span style=\" font-size:10pt;\"><br/>Thank you very much to all of the people behind the sources of inspiration for this project that I mentioned above. For helping me to learn python from scratch, I would like to thank the following creators on YouTube who were INCREDIBLY helpful and insightful: Bro Code, TechWithTim, NeuralNine, TurbineThree, Coding With Russ, and Code First With Hala. I would also like to thank dueg-oth and Clkr-Free-Vector-Images at Pixabay for creating the royalty-free assets I used to create this project. I would like to extend a warm, heartfelt thank you to my community members, who supported me and listened to me gush and gripe through my many successes and setbacks. Finally, thank you, the end user, very, very, much, for using Scurry. To think that something like Scurry, once a figment of my imagination, is now real and having a positive impact on the lives of others is everything I could have wanted and more.</span></p></body></html>"))
        self.tabwidgetPage.setTabText(self.tabwidgetPage.indexOf(self.tabAbout), _translate("formConfig", "About"))
        self.lblKnownIssues.setText(_translate("formConfig", "<html><head/><body><p align=\"center\"><span style=\" font-size:11pt; text-decoration: underline;\">KNOWN ISSUES:</span></p><p align=\"center\"><span style=\" font-size:8pt;\">(Scurry Mouse Visualizer v1.0.0)</span></p><p>1) Clicking and dragging the Scurry app causes severe lag for a few seconds. There seems to be some sort of timeout that happens after a few seconds, so if you click and drag the window, just hold down left click for a while and you will eventually be able to drag it. I unfortunately don\'t know how to solve this issue as it is beyond my understanding. The Scurry app is powered by a python library called &quot;Pygame&quot; and the mouse input is tracked by a python library called &quot;Pynput.&quot; All I know is that Pynput does not like it when you try to click and drag a Pygame window contianing the pynput.mouse.Listener() object.</p><p>2) The &quot;^^Help Me Set These^^&quot; window measuring tool sometimes freezes. In my short and unscientific testing I\'m pretty sure I\'ve mitigated this problem, but ultimately this is again one of those bugs that is beyond my understanding. If it does freeze, you should be able to close the window and try again.</p><p>3) The &quot;Hex&quot; fields of the color picker have a quite annoying behavior of moving the cursor to the end of the text after each keystroke. As such, it isn\'t really practical to delete and replace the beginning or middle sections of a hex-color key. I do not currently have a solution for this at this time, as I think this effect is an unfortunate byproduct of the logic necessary for formatting these fields and updating the color pickers.</p><p>4) I have literally no clue how to test this app for performance impact, nor do I have any idea how to improve the performance of this app. I haven\'t personally noticed a large performance impact unless I kick the framerate way up, but I have a relatively powerful machine, and so I don\'t really have any useful annecdotal experience with how the app will perform on other, potentially less powerful hardware.</p><p align=\"center\"><span style=\" font-size:9pt;\">(I do plan on updating this list as new bugs and crashes are discovered. In a perfect world, though, I would hope that someone out there can help find good solutions to the problems here, and maybe this page can be removed from the app entirely.)</span></p></body></html>"))
